import React from 'react';
import ReactDOM from 'react-dom';
import Router from './Router';
import {Provider} from 'react-redux'
import Home from './Home';
const APP = (
  <Provider>
    <Home/>
  </Provider>
)
ReactDOM.render(
  APP,
  document.getElementById('root')
);
